import React from 'react';
import './todoitem.css';

function TodoItem(props) {
    const {items} = props;
  return (
    <div>
        
            <table>

                {items.map((item)=>(    
                <tr key={item.id}>
                    <td>{item.name}</td>
                    <td>{item.age}</td>
                </tr>
                ))}
            </table>
        
    </div>
  )
}

export default TodoItem
